  selector: 'app-main',
  templateUrl: './main.component.html',
  styleUrls: ['./main.component.scss']
})
export class MainComponent {

  projects = projects

  render() {
    if(!Array.isArray(this.projects[0].nf_building)) {
      let building = this.projects[0].nf_building;  
    } else for (let build of this.projects[0].nf_building) {
      let building = build
    }
  }

}
